{color:#172B4D} Hi Alanna,{color}{color:#172B4D}{color}  

{color:#172B4D} The driver (Rodney) informed me that the Lutheran Church typically receives their orders at 8:00 AM. He wanted to ensure that she didn't receive her food late, so he decided to deliver it to her first. I advised the driver to follow the instructions provided on his phone and on paper from now on. He explained that he was just trying to help her out.{color}{color:#172B4D}{color}   

{color:#172B4D} Best regards,{color}  
{color:#172B4D} Karen{color} 
----

{color:#172B4D}{color}"", ""comment4"": ""11/19/2024 03:48;61536ea272f6970069fc1dbd;

Good afternoon, Alanna,

Thank you for passing this along. It looks like Karen has respondedâ€”thank you, Karen! Could we also schedule a pallet pickup for Abiding Presence by the end of the week, preferably as soon as possible?

Thank you, Alanna, for your feedback!

Best,  
""D"""", ""comment5"": ""11/20/2024 06:26;6064f0f7ea084b006917382f;{color:#172B4D}Good morning,{color}{color:#172B4D}{color}  

{color:#172B4D} Yes, I can schedule a pallet pickup for Abiding today.{color}{color:#172B4D}{color}{color:#172B4D}{color}{color:#172B4D}{color}   



{color:#172B4D} Thanks,{color} 
{color:#172B4D} Karen{color}{color:#172B4D}{color} 
----

{color:#172B4D}{color}"", ""comment6"": ""11/20/2024 06:27;6064f0f7ea084b006917382f;{color:#172B4D}I believe we have already picked up the pallets from the Lutheran Church of the Abiding.{color}{color:#172B4D}{color} 
