{color:#333333}Good morning,{color} 

{color:#333333}Thank you for reaching out. We will not be hosting another training session, but there are tools available to assist you. You can find a guide in PDF format called ""Hours of Operations"" under the Partner Resource Tab on PartnerLink. This document provides instructions on how to update your hours of operation.{color} 

{color:#333333}Once you are logged into PartnerLink, click on your agency name to access your Account Overview. Under Additional Information, you will find a button labeled ""Hours of Operations."" Click on it to view the hours currently listed for your agency. If the hours are correct, click ""verify"" to confirm. If the hours are not correct, please make the necessary changes by clicking â€œeditâ€, submit them, and once approved by your Regional Coordinator, the updated hours will be officially updated.{color} 

{color:#333333}If you still need assistance please attend one of our online Office Hours every Wednesday from 10am-10am:{color} [https://capitalareafoodbank.zoom.us/zbook/partner-support/customer-relations-office-hours

