thumbnail!"", ""comment2"": ""02/21/2025 09:48;61536ea272f6970069fc1dbd;Good morning Jeanette,

I hope youâ€™re doing well today. I was very concerned to hear about the issues youâ€™ve encountered with mice droppings and the presence of mice near the food you received from us. Please know that I am genuinely sorry for this distressing experience, and I want to extend my heartfelt apologies on behalf of Capital Area Food Bank and our Customer Service and Operations Team.

This morning, I forwarded the information you provided in your ticket, along with your photos, to our Director of Operations. She is taking this matter very seriously and has scheduled a meeting with her team to ensure we find a prompt and effective resolution. They will be focusing on maintaining cleanliness and ensuring rodent protection in our facilities, as well as inspecting our warehouse products, particularly those in question, to ensure they are removed if necessary.

I want to support you through this situation. Could you please let me know which specific products you needed to be disposed of due to the potential rodent issue, aside from the bins of cereal? I understand how disruptive this can be to your food distribution efforts, and I truly empathize with the challenges it presents in providing safe and healthy food to the community you serve.

I will also reach out to my supervisor to discuss possible compensation for the inconvenience caused by this situation, as we value your partnership and want to make things right.

Thank you for your understanding, and once again, Iâ€™m truly sorry for the trouble this has caused. We are committed to resolving this matter as quickly as possible.

Best wishes,  
""D"""", ""comment3"": ""02/25/2025 08:11;qm:65d20c5a-0c84-458e-8ce1-adb90d07460f:dfe95375-aec2-4b96-a441-1ef83b9b12fb;{color:#172B4D}Dear ""D"",{color} 
{color:#172B4D} Thank you so much for your prompt response and for addressing this matter with great regard. We look forward to hearing back from your side the resolution made from your side so this situation can be avoided.{color}{color:#172B4D}{color}   

{color:#172B4D} When it comes to your questions around damages and pain points that we encounter to intervene quickly here are some of the damages it costs my operations:{color} 
*  
{color:#172B4D}We disregard about 50 Rx Boxes that were packed and ready for distribution to our Food as Medicine Program (this is worth $25 each box){color} 
*  
{color:#172B4D}We halted our packing operations (2 days' worth) and had caused me loss of 500 Rx Boxes that should have been packed last week. Instead, we used the time to do a deep cleaning to ensure all our 800 Rx Boxes are safe.{color} 
*  
{color:#172B4D}We also use two additional days of work to contain and capture the three mice and safely throw the 2 bins of assorted cereals out of our building premises (into a landfill). (Note: I personally set aside my own list of tasks to help my team do this work for two days and also recruit four people to assist us with this problem){color}{color:#172B4D}{color} 


{color:#172B4D} I hope this helps you and your organization understand how this type of matters can cause a small organization like ours not only inconvenience/stress but lost of products/investment/productivity for some of our programs outside our Food Pantry operations.{color}{color:#172B4D}{color} 
