Capital Area Food Bank"", ""comment3"": ""07/18/2024 01:41;712020:44f76476-84e5-4a70-9ec9-f416f5d62412;{color:#172B4D}Under normal circumstances, yes. However, while speaking with Charity during the training and relaying that I would like to separate the locations, she told me in stead of selecting my own credentials through the link, CAFB would create them for me using my email address for all but a different password for each. Because of this special circumstance, she said that I would not have received the usual email. I would receive an email detailing all locations and passwords.{color} 
----

{color:#172B4D}{color}"", ""comment4"": ""07/18/2024 02:04;63a625d8347fae534682c9b1;{color:#172B4D}Okay I see, my apologies! Currently, we have New Hope Housing Kennedy Shelter on Richmond Highway in our records as your approved address. Our partner support team will be happy to get you the login in to that account. If you would like to add a different location, I will need to conduct a site visit to ensure food safety and we will need to have a larger conversation around how the food will be distributed between the two sites. I believe when we spoke on the phone previously, we agreed you would begin ordering again for the Kennedy Shelter to see the types of food we have available. I understood then from there we would see if it made sense to add another location or not based on the different needs. Just a reminder, CAFB food can only be delivered to and stored at the Kennedy Shelter address.{color}{color:#172B4D}{color}   

{color:#172B4D} Please let me know if that helps.{color}{color:#172B4D}{color}  

{color:#172B4D} Best,{color} 
{color:#172B4D} Alanna{color}{color:#172B4D}{color} 
----

